static void invoke_recorder_command(int NCode, int Id)
{
    printf("[%s] id=%d, NCode=%d, \n", __func__, Id, NCode);
    if (NCode == WM_NOTIFICATION_RELEASED)
    {
        switch (Id)
        {
        case ID_IMAGE_0://Stop
            recorder_stop();
            break;
        case ID_IMAGE_1://Record
            recorder_start();
            break;
        }
    }
}

void update_gui_widgets(WM_HWIN hWin, E_NM_RECORD_STATUS eStatu_now)
{
    static E_NM_RECORD_STATUS eStatus = eNM_RECORD_STATUS_ERROR;
    static uint64_t u64CurrentInSec_Current = 0;

    uint64_t u64CurrentInSec_Current_now = recorder_recordedtime_current() / 1000;

    if (eStatus != eStatu_now)
    {
        if (hWin)
        {
            WM_HWIN  hItem_record = WM_GetDialogItem(hWin, ID_IMAGE_1);
            WM_HWIN  hItem_stop = WM_GetDialogItem(hWin, ID_IMAGE_0);
            switch (eStatu_now)
            {
            case eNM_RECORD_STATUS_RECORDING:
                WM_ShowWindow(hItem_stop);
                WM_HideWindow(hItem_record);
                break;

            case eNM_RECORD_STATUS_ERROR:
            case eNM_RECORD_STATUS_STOP:
                WM_ShowWindow(hItem_record);
                WM_HideWindow(hItem_stop);
                break;
            }
        }
        eStatus = eStatu_now;
    }

    // Current time string.
    if (u64CurrentInSec_Current != u64CurrentInSec_Current_now)
    {
        char szTimeStr[16];
        int HH = u64CurrentInSec_Current_now / 60 / 60 % 24;
        int MM = u64CurrentInSec_Current_now / 60 % 60;
        int SS = u64CurrentInSec_Current_now % 60;

        snprintf(szTimeStr, sizeof(szTimeStr), "%02d:%02d:%02d", HH, MM, SS);
        WM_HWIN hItem_current = WM_GetDialogItem(hWin, ID_TEXT_0);
        TEXT_SetText(hItem_current, szTimeStr);
        u64CurrentInSec_Current = u64CurrentInSec_Current_now;
    }

}
